import React from 'react';

import { BsHeartFill, BsHeart, BsUpload, BsBookmark, BsBookmarkFill, BsChat } from "react-icons/bs";

const Toolbar = () => {
  return(
    <div>
      <table>
        <tr>
          <td>{BsHeart}</td>
          <td>{BsChat}</td>
          <td>{BsUpload}</td>
          <td>{BsBookmark}</td>
        </tr>
      </table>
    </div>
  );
}

export default Toolbar;
